	add("semanticity", "{\"term\":\"semanticity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|semantic|ity}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of a linguistic system has being able to convey meaning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The condition of being semantic\", \"priority\":2}]}, \"synonyms\":{}}");

	add("semantics", "{\"term\":\"semantics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027sémantique\u0027 displacing earlier \u0027semasiology\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of linguistics studying the meaning of words\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Semantics\u0027\u0027 is a foundation of lexicography\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The study of the relationship between words and their meanings\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Patrick Blackburn, Johan Bos, and Kristina Striegnitz, \u0027[http://www.learnprolognow.org/lpnpage.php?pagetype\u003dhtml\u0026amp;pageid\u003dlpn-htmlse32 Learn Prolog Now!]\u0027, section 8.1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In fact, nowadays a lot is known about the \u0027\u0027semantics\u0027\u0027 of natural languages, and it is surprisingly easy to build semantic representations which partially capture the meaning of sentences or even entire discourses\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The individual meanings of words, as opposed to the overall meaning of a passage\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027semantics\u0027\u0027 of the terms used are debatable\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027semantics\u0027\u0027 of a single preposition is a dissertation in itself\", \"priority\":8}]}, \"synonyms\":{}}");

	add("semantogram", "{\"term\":\"semantogram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|semanto|gram|lang\u003den}}, thus literally \u0026quot;meaning drawing.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A symbol used solely for meaning, as when logographic Chinese symbols are used to represent the meaning of native Japanese words\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Herbert Franke and Dennis Twitchett, \u0026quot;Introduction\u0026quot;, in \u0027The Cambridge History of China\u0027 [http://books.google.com/books?id\u003diN9Tdfdap5MC], ISBN 0521243319, page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;the majority of Jurchen signs, which included both \u0027\u0027semantograms\u0027\u0027 and phonograms, were inventions.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("semaphore", "{\"term\":\"semaphore\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"Borrowed in 1816 from French \u0027sémaphore\u0027 coined in French from Ancient greek (to 1453) \u0027σῆμα\u0027 (sign) and \u0027\u0027 (-φωρος) from \u0027φέρω\u0027 (to bear, carry)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any visual signaling system with flags, lights, or mechanically moving arms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Gene Weingarten, \u0027Old Dogs: Are the Best Dogs\u0027, Simon \u0026amp; Schuster, page 4 [http://books.google.com/books?id\u003dGOUMoGLf9tYC\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003dgene+weingarten\u0026amp;source\u003dbl\u0026amp;ots\u003dBgRdWbPGYP\u0026amp;sig\u003dgd-Mgu3cNEgerci0w2psNOA6ZjM\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGDIVUNqbDcOYqAGZx4HgBQ\u0026amp;ved\u003d0CDgQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dsemaphore\u0026amp;f\u003dfalse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Consider the wagging tail, the most basic \u0027\u0027semaphore\u0027\u0027 in dog/human communication\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A visual system for transmitting information by means of two flags that are held one in each hand, using an alphabetic and numeric code based on the position of the signaler’s arms\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A bit, token, fragment of code, or some other mechanism which is used to restrict access to a shared function or device to a single process at a time, or to synchronize and coordinate events in different processes\", \"priority\":6}]}, \"synonyms\":{}}");

	add("semasiology", "{\"term\":\"semasiology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027σημασία\u0027 (lang\u003dgrc) + \u0027lang\u003dgrc|-λογία\u0027 () from \u0027σημαίνω|lang\u003dgrc\u0027 () from \u0027σῆμα\u0027 (a mark, sign)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Semantics; A discipline within linguistics concerned with the meaning of a word independent of its phonetic expression\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Federica Busa, et al., \u0027The Language of Word Meaning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;The early theories of \u0027\u0027semasiology\u0027\u0027 attempted to account for meaning shifts in language.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Nicolas Slonimsky, et al., \u0027The Listener\u0027s Companion: Great Composers and Their Works\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It must be left to students of musical \u0027\u0027semasiology\u0027\u0027 to account for the psychological association that exists between the spiritual concept of goodness and saintliness and the notational accident of the absence of sharps and flats in the key signature, which results in the \u0027whiteness\u0027 of the music\", \"priority\":5}]}, \"synonyms\":{}}");

