	add("semiquadrate", "{\"term\":\"semiquadrate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|semi|quadrate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aspect of the planets when distant from each other by half a quadrant, or forty-five degrees, or one sign and a half\", \"priority\":1}]}, \"synonyms\":{}}");

