	add("semiring", "{\"term\":\"semiring\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|semi|ring|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An algebraic structure similar to a ring, but without the requirement that each element must have an additive inverse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the incomplete rings of the upper part of the bronchial tubes of most birds, forming an essential part of the syrinx of songbirds\", \"priority\":2}]}, \"synonyms\":{}}");

