	add("semisomnia", "{\"term\":\"semisomnia\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027semi-\u0027 (half) + \u0027somnus\u0027 (sleep) + {{l|la|-ia}}. Compare with \u0027\u0027 Coined by British sleep expert Neil Stanley in 2007.\u0026lt;ref\u0026gt;Moira Petty, \u0026quot;[http://www.dailymail.co.uk/health/article-489123/Are-millions-Britons-suffering-semi-somnia.html Are you one of the millions of Britons suffering from \u0027semi-somnia\u0027?]\u0026quot;, \u0027Daily Mail\u0027, 24 October 2007\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chronic state of low-grade exhaustion caused by too little or fitful sleep\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Catherine Vonledebur, \u0026quot;[http://www.thefreelibrary.com/Your+Life+daily%3A+Too+tired+to+get+night\u0027s+sleep.-a0172158759 Too tired to get night\u0027s sleep]\u0026quot;, \u0027Coventry Evening Telegraph\u0027, 7 December 2007\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Like many people, Heidi is suffering from the effects of modern society\u0027s non-stop nature, and she is also struggling to separate her work and home life - what I call the \u0026quot;Blackberry-Bushed\u0026quot; cause of \u0027\u0027semisomnia\", \"priority\":3}]}, \"synonyms\":{}}");

	add("semisupination", "{\"term\":\"semisupination\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|semi|supination|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The position of the forearm wherein the thumb is pointing upwards\", \"priority\":1}]}, \"synonyms\":{}}");

	add("semisynthesis", "{\"term\":\"semisynthesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|semi|synthesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of chemical synthesis that uses compounds isolated from natural sources (such as plant material or bacterial cultures) as starting materials\", \"priority\":1}]}, \"synonyms\":{}}");

	add("semite", "{\"term\":\"semite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"ancient hebrew\"], \"text\":\"French \u0027sémite\u0027 from {{m|la|Sem}}, from Ancient greek (to 1453) \u0027σημ\u0027 from Ancient hebrew \u0027שם\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of any of a number of peoples of ancient southwestern Asia and East Africa such as the Akkadians, Assyrians, Arameans, Phoenicians, Canaanites, Hebrews, Arabs and Aksumites\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A descendant of any of these peoples\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A member of a modern people that speak a Semitic language\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A descendant of the biblical Patriarch Shem\", \"priority\":4}]}, \"synonyms\":{}}");

