	add("semitics", "{\"term\":\"semitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the Semitic languages, cultures and peoples\", \"priority\":1}]}, \"synonyms\":{}}");

	add("semitism", "{\"term\":\"semitism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Semite|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase (construction or idiom) typical of or influenced by Hebrew or Aramaic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Takamitsu Muraoka, \u0027Septuagint Lexicography\u0027, in \u0027Biblical Greek Language and Lexicography\u0027 (edited by Bernard A. Taylor, John A. L. Lee, Peter R. Burton and Richard E. Whitaker; ISBN 0-8028-2216-9), page 85\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The main reason for this neglect is the fact that it is largely a translated text, a fact which is alleged to account for its strange idiom tinged with Semitic traits, largely in syntax and lexicography. For sure, one can easily identify countless \u0027\u0027Semitisms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, James R. Edwards, \u0027The Hebrew Gospel and the Development of the Synoptic Tradition\u0027 (ISBN 0802862349), page 142\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In other words, 93% of the \u0027\u0027Semitisms\u0027\u0027 in Luke — more than nine out of 10 \u0027\u0027Semitisms\u0027\u0027 in the chart — are unique to Luke. Of all Luke\u0027s \u0027\u0027Semitisms\u0027\u0027, only 15 (\u003d 2%) appear in common with both Matthew and Mark\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Simon Gathercole, \u0027The Composition of the Gospel of Thomas\u0027 (ISBN 1107378397\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Finally, we can identify certain idioms clearly of Semitic origin, but which are not found in the Bible – one might term them post-biblical \u0027\u0027Semitisms\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Semitic character; Semiticness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Martin Kramer, \u0027Shi\u0027ism, resistance and revolution\u0027, page 22\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In a Europe which was obsessed by race, some saw the division as one between Semites and Aryans, the Sunnis representing the \u0027\u0027Semitism\u0027\u0027 of Arabian Islam, the Shi\u0027a representing the upsurge of Aryan Iran\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Kanan Makiya, \u0027Republic of Fear: The Politics of Modern Iraq\u0027 (ISBN 0520921240), page 264\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Persian \u0026quot;Aryanism\u0026quot; and Arab \u0026quot;\u0027\u0027Semitism\u0027\u0027\u0026quot; are of course myths with a toehold on reality located somewhere in the origins of languages, not peoples\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Bernard Lewis, \u0027Islam in History\u0027, page 276\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"the Aryanism of Iran in generous revolt against the alien and constricting \u0027\u0027Semitism\u0027\u0027 of Arabian Islam\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Judaism; Jewishness\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Richard S. Geehr, \u0027Karl Lueger: Mayor of Fin de Siècle Vienna\u0027 (ISBN 0814320783), page 30\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"a racist coloration through the inclusion of another remark of Albert Gessmann: when the more radical nationalists fell silent a merger of all Aryans against the common danger of \u0027\u0027Semitism\u0027\u0027 will be the next consequence\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Roderick Stackelberg, \u0027Hentschel, Willibald (1858–1947)\u0027, in \u0027Antisemitism: A Historical Encyclopedia of Prejudice\u0027 (ISBN 1851094393\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Only a strong countermovement could prevent the triumph of \u0027\u0027Semitism\u0027\u0027 all over the world. The urgent task for Germans was to overcome the \u0027\u0027Semitism\u0027\u0027 within themselves, and racial hygiene was the means to this end\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Marius Turda, ‎Paul Weindling, \u0027\u0026quot;Blood and Homeland\u0026quot;: Eugenics and Racial Nationalism in Central and Southeast Europe, 1900–1940\u0027 (ISBN 9637326812\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"If the victory of \u0027\u0027Semitism\u0027\u0027 meant the death of the nation, the reverse was also true: the triumph of the nation implied the elimination of the Semites. Why were Jews painted in such a negative light\", \"priority\":21}]}, \"synonyms\":{}}");

